import React from "react";
import { Link } from "react-router-dom";
import Login from "./Login";
import Signup from "./signup";
const Home = () => {
  return (
    <ul>
      <Link to="/Login">Login </Link>
      <Link to="/Signup">Signup </Link>
    </ul>
  );
};
export default Home;
